import { StyleSheet, Dimensions } from "react-native";
import Constants from "expo-constants";

export const Style = StyleSheet.create({
  _login_container: {
    paddingTop: Constants.statusBarHeight * 2,
    height: Dimensions.get("window").height,
    // height: Dimensions.get("screen").height,
  },
  _login_wrapper: {
    flex: 1,
    // justifyContent: "center",
    alignItems: "center",
  },
  _top_wrapper: {
    borderRadius: 5,
    width: Dimensions.get("window").width - 50,
  },
  _title_wrapper: {
    marginBottom: 30,
  },
  _header_title: {
    fontSize: 24,
  },
  _input_number: {
    paddingTop: 5,
    paddingBottom: 5,
    paddingRight: 15,
    paddingLeft: 15,
    marginBottom: 20,
    borderRadius: 5,
    borderWidth: 1,
    borderColor: "#E7E7E7",
    color: "#585757",
  },
  _input_password: {
    paddingTop: 5,
    paddingBottom: 5,
    paddingRight: 15,
    paddingLeft: 15,
    borderRadius: 5,
    borderWidth: 1,
    borderColor: "#E7E7E7",
    color: "#585757",
  },
  _input_title: {
    fontSize: 16,
    marginBottom: 10,
  },
  _login_btn: {
    backgroundColor: "#3CA2FA",
    width: Dimensions.get("window").width - 50,
    marginLeft: 20,
    marginRight: 20,
    marginTop: 20,
    padding: 10,
    borderRadius: 5,
  },
  _login_title: {
    fontSize: 16,
    color: "white",
    textAlign: "center",
  },
  _checkbox_wrapper: {
    marginTop: 20,
    flexDirection: "row",
    width: Dimensions.get("window").width - 50,
    alignItems: "center",
  },
  _checkbox: {
    marginRight: 10,
  },
  _checkbox_title: {
    color: "#585757",
    fontSize: 16,
  },
  _forgot: {
    marginTop: 20,
  },
  _forgot_title: {
    color: "#3CA2FA",
    fontSize: 16,
  },
  _line: {
    height: 1,
    width: Dimensions.get("window").width - 50,
    marginBottom: 20,
    marginTop: 20,
    backgroundColor: "#E7E7E7",
  },
  _signup_wrapper: {
    alignItems: "center",
  },
  _sign_account: {
    color: "#585757",
    fontSize: 16,
  },
  sign_title_link: {
    color: "#3CA2FA",
    fontSize: 16,
  },
});
